function Takas() {
  const [hesaps, setHesaps] = useState([]);
  const [seciliHesap, setSeciliHesap] = useState({});
  const getData = async () => {
    const result = await getHesaps();
    console.log(result);
    setHesaps(result.data);
  };

  useEffect(() => {
    getData();
  }, []);
  function handleSelect() {
    console.log("Hello");
  }

  return (
    <>
      <p className=" m-4">İşlem yapılıcak hesabı seçiniz.</p>
      <HesapBilgileri onClick={handleSelect}></HesapBilgileri>
    </>
  );
}

export default Takas;
